import { Enser } from './enser';

export class Caja<T extends Enser> {
  private _contenido: T[];

  constructor(contenido? :T[]) {
    if (contenido) {
      this._contenido = contenido;
    } else {
      this._contenido = [];
    }
  }

  get contenido(): T[] {
    return this._contenido;
  }

  addEnser(enser: T): void {
    this._contenido.push(enser);
  }

  removeEnser(enser: T): void {
    const index = this._contenido.indexOf(enser);
    if (index > -1) {
      this._contenido.splice(index, 1);
    } else {
      throw new Error('El enser no se encuentra en la caja');
    }
  }

  printContenido(): void {
    console.log('Contenido de la caja:');
    this._contenido.forEach((enser) => {
      console.log('-->  ' + enser._nombre);
    });
  }

  searchEnser(enser: T): boolean {
    return this._contenido.includes(enser);
  }
}

export type Producto = [string, number];

export class Factura {
  private _nombreEmpresa: string;
  private _numeroFactura :number;
  private _concepto :string;
  private _productos: Producto[];
  private _precioTotal: number;
  private _fecha: string;

  constructor(nombreEmpresa: string, numeroFactura: number, concepto: string, productos: Producto[], fecha: string) {
    this._nombreEmpresa = nombreEmpresa;
    this._numeroFactura = numeroFactura;
    this._concepto = concepto;
    this._productos = productos;
    this._fecha = fecha;
    this._precioTotal = this._productos.reduce((acc, [_, precio]) => acc + precio, 0);
  }

  get nombreEmpresa(): string {
    return this._nombreEmpresa;
  }

  get numeroFactura(): number {
    return this._numeroFactura;
  }

  get concepto(): string {
    return this._concepto;
  }

  get productos(): Producto[] {
    return this._productos;
  }

  get precioTotal(): number {
    return this._precioTotal;
  }

  get fecha(): string {
    return this._fecha;
  }

  print(): string {
    return `Factura de ${this.nombreEmpresa}\nNúmero de factura: ${this.numeroFactura}\nConcepto: ${this.concepto}\nProductos:\n${this.productos.map(([nombre, precio]) => `- ${nombre}: ${precio}€`).join('\n')}\nPrecio total: ${this.precioTotal}€\nFecha: ${this.fecha}`;
  }
}

import { Factura } from './factura';
import { FacturaPDF } from './facturapdf';
import { FacturaHTML } from './facturahtml';

export class Sistema {
  private _factura: Factura;

  constructor(factura: Factura) {
    this._factura = factura;
  }

  get factura(): Factura {
    return this._factura;
  }

  imprimirFactura(): string {
    console.log(this.factura.print());
    return this.factura.print();
  }

  facturaEnPDF(): string {
    const facturaPDF = new FacturaPDF(this.factura.nombreEmpresa, this.factura.numeroFactura, this.factura.concepto, this.factura.productos, this.factura.fecha);
    console.log(facturaPDF.toPDF());
    return facturaPDF.toPDF();
  }

  facturaEnHTML(): string {
    const facturaPDF = new FacturaHTML(this.factura.nombreEmpresa, this.factura.numeroFactura, this.factura.concepto, this.factura.productos, this.factura.fecha);
    console.log(facturaPDF.toHTML());
    return facturaPDF.toHTML();
  }
}

import { Factura } from './factura';

export class FacturaPDF extends Factura {
  constructor(nombreEmpresa: string, numeroFactura: number, concepto: string, productos: [string, number][], fecha: string) {
    super(nombreEmpresa, numeroFactura, concepto, productos, fecha);
  }

  toPDF(): string {
    return `Factura: ${this.numeroFactura}\nEmpresa: ${this.nombreEmpresa}\nFecha: ${this.fecha}\nConcepto: ${this.concepto}\nProductos: ${this.productos.map(([nombre, precio]) => `${nombre} - ${precio}€`).join(', ')}\nPrecio total: ${this.precioTotal}€`;
  }
}

import { Factura } from './factura';

export class FacturaHTML extends Factura {
  constructor(nombreEmpresa: string, numeroFactura: number, concepto: string, productos: [string, number][], fecha: string) {
    super(nombreEmpresa, numeroFactura, concepto, productos, fecha);
  }

  toHTML(): string {
    return `
    <html>
      <head>
        <title>Factura</title>
      </head>
      <body>
        <h1>Factura de ${this.nombreEmpresa}</h1>
        <p>Número de factura: ${this.numeroFactura}</p>
        <p>Concepto: ${this.concepto}</p>
        <h2>Productos:</h2>
        <ul>
          ${this.productos.map(([nombre, precio]) => `<li>${nombre}: ${precio}€</li>`).join('')}
        </ul>
        <p>Precio total: ${this.precioTotal}€</p>
        <p>Fecha: ${this.fecha}</p>
      </body>
    </html>
    `;
  }
}

